import React from 'react'
import './SideBar.css'
import GoogleLogin from '../GoogleLogin/GoogleLogin'

class SideBar extends React.Component{    

    render(){

        return (
            <div className="Sidebar">
                <GoogleLogin />
                <img src="" alt="Profile Picture" />
                <h3>Email</h3>
                <p>UserName</p>
            </div>
        )
    }
}

export default SideBar
